import Link from 'next/link'

const Contact = () => {
    return (
        <>
            <nav>
                <Link href= {'/'}><a>Home</a></Link>
                <Link href= {'/about'}><a>About</a></Link>
                <Link href= {'/contact'}><a>Contact Us</a></Link>      
            </nav>
            <h1>contact page </h1>
        </>
    )

}   
export default Contact;
